// YAxisWrapper.js
import React from 'react';
import { YAxis } from 'recharts';

const YAxisWrapper = ({ label }) => {
  return (
    <YAxis
      label={label}
      orientation="left" // Orientacija ose, levo u ovom slučaju
      width={80} // Širina ose, prilagoditi prema potrebi za prikaz etikete
      tick={{ fontSize: 14 }} // Stilizacija za oznake (ticks)
    />
  );
};

export default YAxisWrapper;
